import { useState } from "react"; 


function SearchProduct() {

    const [productDetails, setProductDetails] = useState(null);

    return <>
        <div id='productId'>
            <div id='serach'>  
                <p> Search Product : &nbsp;
                    <input type='text' /> &nbsp;
                    <button id='btn'> Search Product</button>
                </p>
            </div>
            <div id='body'>
                <p>Search Result</p>
                {productDetails == null ?<p>Not Found</p>:<p>Result</p>}

            </div>
        </div>
    </>
}

export default SearchProduct;
